INSERT INTO `tweets` (`id`,`date`,`time`,`text`,`processed_text`,`hashtag`,`sentiment`,`serie`,`language`) VALUES (1059297944652990000,'05-nov-18','02:14:45','Os personagens falecidos que o Rick viu em suas alucinações foram um ponto altíssimo do episódio. Mas senti falta de alguns personagens muito importante, tipo a Lori, o Glenn e principalmente o Carl. #TWD #T09E05 #AdeusRick #TWD9naFOX','The characters of the deceased that Rick saw in his hallucinations were a point most high of the episode. But I felt lack of some of the characters very important, like Lori, Glenn, and especially Carl.','[\'#twd\', \'#t09e05\', \'#adeusrick\', \'#twd9nafox\']',1,'TWD','PT');
INSERT INTO `tweets` (`id`,`date`,`time`,`text`,`processed_text`,`hashtag`,`sentiment`,`serie`,`language`) VALUES (1059297953410630000,'05-nov-18','02:14:47','Já sobre os lugares que o Rick “visitou”, gostei muito de rever o leito e o hospital que o Rick esteve internado durante o coma, e a fazenda do Hershel com o celeiro ao fundo. Mas queria muito que tivessem mostrado a prisão também. #TWD #T09E05 #AdeusRick','Already about the places in which Rick “visits”, I really enjoyed reviewing the bed and the hospital that Rick was admitted to the hospital during the coma, and the farm of Hershel with the barn in the background. But I really wanted that had shown the prison also.','[\'#twd\', \'#t09e05\', \'#adeusrick\', \'#twd9nafox\']',1,'TWD','PT');
INSERT INTO `tweets` (`id`,`date`,`time`,`text`,`processed_text`,`hashtag`,`sentiment`,`serie`,`language`) VALUES (1059297956401160000,'05-nov-18','02:14:48','A conversa da Maggie com o Negan foi de partir o coração. Deu pra sentir toda a raiva que a Maggie carrega, ao mesmo tempo que deu pra sentir o desespero do Negan. Ele deixou de se esconder nas sombras e mostrou o seu lado mais humano. #TWD #T09E05 #Adeus','The conversation of Maggie with the Negan was from the heart. Made to feel all the rage that Maggie loads, while at the same time made to feel the despair of Negan. He left to hide in the shadows, and showed his side more human.','[\'#twd\', \'#t09e05\', \'#adeusrick\', \'#twd9nafox\']',1,'TWD','PT');
INSERT INTO `tweets` (`id`,`date`,`time`,`text`,`processed_text`,`hashtag`,`sentiment`,`serie`,`language`) VALUES (1059297958661890000,'05-nov-18','00-jan-00','Quando o Rick acorda no acampamento e depois chega na ponte, eu achei que seria o fim dele ali. E eu fiquei bem triste, porque achei que ele morreria sozinho. Aí vi todos chegando pra salvar ele e... era só mais uma alucinação! #TWD #T09E05 #AdeusRick #TW','When Rick wakes up in camp and then arrives at the bridge, I thought that would be the end of him there. And I was very sad, because I thought that he would die alone. There I saw all coming to save him and... it was just another hallucination!','[\'#twd\', \'#t09e05\', \'#adeusrick\', \'#twd9nafox\']',2,'TWD','PT');
INSERT INTO `tweets` (`id`,`date`,`time`,`text`,`processed_text`,`hashtag`,`sentiment`,`serie`,`language`) VALUES (1059297961635700000,'05-nov-18','02:14:49','Mas aí ele acorda e de fato todos chegam. Mesmo sabendo que esse seria o último episódio dele, ver essa cena me deu um fio de esperança... Até que ele dá aquele tiro certeiro nas dinamites, se sacrificando pra salvar todos que ele ama. ?? #TWD #T09E05 #Ad','But then he wakes up and we all arrive. Even knowing that this would be the last episode of it, to see this scene gave me a thread of hope... Until he gives one well-aimed shot into the dynamite, sacrificing himself to save all that he loves. ??','[\'#twd\', \'#t09e05\', \'#adeusrick\', \'#twd9nafox\']',1,'TWD','PT');
INSERT INTO `tweets` (`id`,`date`,`time`,`text`,`processed_text`,`hashtag`,`sentiment`,`serie`,`language`) VALUES (1059297962428370000,'05-nov-18','02:14:49','Un gran líder se mide por su sencillez y por sus actos, tomar decisiones difíciles, es una gran responsabilidad gran final #ThankYouAndy #TheWalkingDead  pic.twitter.com/nJe6zecKSY','A great leader is measured by its simplicity and by their actions, make difficult decisions, it is a great responsibility grand final','[\'#thankyouandy\', \'#thewalkingdead\']',3,'TWD','ESP');
INSERT INTO `tweets` (`id`,`date`,`time`,`text`,`processed_text`,`hashtag`,`sentiment`,`serie`,`language`) VALUES (1059297964013820000,'05-nov-18','02:14:50','O sacrifício do Rick e a reação do Daryl e da Michonne ao perceberem o que havia acontecido me deixaram completamente sem chão... #TWD #T09E05 #AdeusRick #TWD9naFOX','The sacrifice of Rick and the reaction of Daryl and Michonne as they realized what had happened they left me completely without the ground...','[\'#twd\', \'#t09e05\', \'#adeusrick\', \'#twd9nafox\']',1,'TWD','PT');
