INSERT INTO `tweets` (`id`,`date`,`time`,`text`,`processed_text`,`hashtag`,`sentiment`,`serie`,`language`) VALUES (1059297968627550000,'05-nov-18','00-jan-00','Aí vemos a Jadis com o famoso helicóptero se aproximando e BOOOM! Lá está o Rick, VIVO, nas margens do rio. É nesse momento que o episódio vira de ponta-cabeça e eu fico sem entender mais nada! #TWD #T09E05 #AdeusRick #TWD9naFOX','There we see the Jadis with the famous helicopter approaching and BOOOM! There is Rick, I LIVE on the banks of the river. This is where the episode turns upside down and I\'m not understanding anything more!','[\'#twd\', \'#t09e05\', \'#adeusrick\', \'#twd9nafox\']',1,'TWD','PT');
INSERT INTO `tweets` (`id`,`date`,`time`,`text`,`processed_text`,`hashtag`,`sentiment`,`serie`,`language`) VALUES (1059297971169380000,'05-nov-18','00-jan-00','Então nos é mostrado que se passou mais um tempo e aí a Judith, a pequena Judith (que já deve estar com a idade do Carl no começo da série), salva um grupo de pessoas. #TWD #T09E05 #AdeusRick #TWD9naFOX','Then we are shown that if he spent more time there and the Judith, the small Judith (who should already be with the age of Carl in the beginning of the series), saves a group of people.','[\'#twd\', \'#t09e05\', \'#adeusrick\', \'#twd9nafox\']',2,'TWD','PT');
